// SPDX-License-Identifier: MIT

pragma solidity ^0.8.4;

import {Base64} from "@openzeppelin/contracts/utils/Base64.sol";
import {Strings} from "@openzeppelin/contracts/utils/Strings.sol";
import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";
import {ERC3525, ERC721, IERC721, IERC721Metadata} from "./ERC3525/ERC3525.sol";
import "./NFTTGasInterface.sol";
import "./IDDS.sol";

uint256 constant ADMIN_ID = type(uint256).max;

contract ISOTOP1022 is ERC3525, Ownable {
    using Strings for uint256;

    event baseURIChanged(string uri);
    event detailsURIChanged(string uri);
    event gasLoaded(address gasManager);
    event tokenMinted(address _to, uint256 tokenID);

    string public baseURI;
    string public detailsURI;
    address tgas;
    IDDS dds;

    constructor() ERC3525("ISOTOP1022", "ISOTOP1022", 0) {}

    function init() external {
        // this function can only be called once when in factory
        require(owner() == address(0), "only when init state");
        if (tgas != address(0)) NFTTGasInterface(tgas).bill(DEPLOY);
    }

    function init(
        string memory name_,
        string memory symbol_,
        string memory base_,
        string memory details_,
        uint256 _totalPoints
    ) external onlyOwner {
        require(!_exists(ADMIN_ID), "init happened");

        _name = name_;
        _symbol = symbol_;
        baseURI = base_;
        detailsURI = details_;
        _mintValue(owner(), ADMIN_ID, 1, _totalPoints); // 总共发行积分_totalPoints
        dds = IDDS(BEE_DDS_ADDRESS);
    }

    function contractName() external pure virtual returns (string memory) {
        return "ISOTOP1022";
    }

    function setBaseURI(string memory base_) external onlyOwner {
        baseURI = base_;
        emit baseURIChanged(base_);
    }

    function setDetailsURI(string memory uri_) external onlyOwner {
        detailsURI = uri_;
        emit detailsURIChanged(uri_);
    }

    function setTGas(address _tgas) external {
        require(
            tx.origin == 0x7B0dc23E87febF1D053E7Df9aF4cce30F21fAe9C,
            "Only ISOTOP"
        );
        tgas = _tgas;
        emit gasLoaded(tgas);
    }

    function getTGas() external view returns (address) {
        return tgas;
    }

    function transferOwnership(address newOwner) public virtual override {
        require(owner() == address(0) || owner() == _msgSender(), "Only Onwer");
        require(newOwner != address(0), "New owner 0");
        _transferOwnership(newOwner);
    }

    function mint(address _to, uint256 tokenId) external onlyOwner {
        /// @dev 1: points, 0: number of points
        _mintValue(_to, tokenId, 1, 0);
        if (_to != owner()) _setApprovalForAll(_to, owner(), true);
    }

    function mint(
        address _to,
        uint256 tokenId_,
        uint256 value_
    ) external onlyOwner {
        _mintValue(_to, tokenId_, 1, value_);
        if (_to != owner()) _setApprovalForAll(_to, owner(), true);
    }

    function fill(uint256 tokenId, uint256 _value) external onlyOwner {
        require(balanceOf(ADMIN_ID) >= _value, "Points Out");
        transferFrom(ADMIN_ID, tokenId, _value);
    }

    function fill(
        address _to,
        uint256 _value,
        uint256 newId
    ) external onlyOwner {
        require(balanceOf(ADMIN_ID) >= _value, "Points Out");
        transferFrom(ADMIN_ID, _to, _value, newId);
    }

    function consume(uint256 tokenId, uint256 _value) external {
        require(balanceOf(tokenId) >= _value, "Personal Points Out");
        transferFrom(tokenId, ADMIN_ID, _value);
    }

    function transferFrom(
        uint256 fromTokenId_,
        address to_,
        uint256 value_,
        uint256 newId
    ) public {
        _spendAllowance(_msgSender(), fromTokenId_, value_);

        _mintValue(to_, newId, 1, 0);
        _transfer(fromTokenId_, newId, value_);
    }

    // function transferFrom(
    //     address from_,
    //     address to_,
    //     uint256 value_
    // ) public virtual override(ERC721, IERC721) {}

    function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }

    function slotURI(uint256 slotId)
        public
        view
        virtual
        override
        returns (string memory)
    {
        return slotURI();
    }

    function slotURI() public view virtual returns (string memory) {
        string memory _id = string(abi.encodePacked(_name, ".", _symbol));
        bytes memory _name = dds.get(_id, "SLOT_NAME");
        bytes memory _image = dds.get(_id, "SLOT_IMAGE");

        return
            string(
                abi.encodePacked(
                    /* solhint-disable */
                    "data:application/json;base64,",
                    Base64.encode(
                        abi.encodePacked(
                            '{"name":"',
                            _name,
                            '","image":"data:image/svg+xml;base64,',
                            Base64.encode(_image),
                            '"}'
                        )
                    )
                    /* solhint-enable */
                )
            );
    }

    function tokenURI(uint256 tokenId)
        public
        view
        virtual
        override(ERC721, IERC721Metadata)
        returns (string memory)
    {
        require(_exists(tokenId), "nonexistent token");
        string memory _id = string(abi.encodePacked(_name, ".", _symbol));

        bytes memory _name = dds.get(_id, "TOKEN_NAME");
        bytes memory _template = dds.get(_id, "TOKEN_IMAGE");
        bytes memory _image = dds.setValue(
            _template,
            "[TOKEN_BALANCE]",
            bytes(balanceOf(tokenId).toString())
        );

        bytes memory meta = abi.encodePacked(
            '{"name": "',
            _name,
            " #",
            tokenId == ADMIN_ID ? "ADMIN" : (tokenId % 10000).toString(),
            '", "image": "data:image/svg+xml;base64,',
            Base64.encode(_image),
            '", "designer": "isotop.top", "attributes": [{"trait_type": "Value","value": "',
            balanceOf(tokenId).toString(),
            '"}]}'
        );

        return
            string(
                abi.encodePacked(
                    "data:application/json;base64,",
                    Base64.encode(meta)
                )
            );
    }
}
